import { makeStyles } from "@material-ui/core";

const APP_BAR = 64;

export default makeStyles({
  // サイドバーの上部にAPP_BAR分のpaddingを表示
  sidebar: {
    paddingTop: APP_BAR,
  },
  // メインコンポーネントの上部にAPP_BAR分のpaddingを表示
  main: {
    paddingTop: APP_BAR + 30,
  },
});
